const AIntro = () => {
  return (
    <>
        <p>At <span className="text-primary bold">iNoteBook</span>, we provide a secure and user-friendly platform for you to organize and manage your notes effortlessly. To access the full suite of features, we've implemented a secure login system to protect your data.</p>
    </>
  );
};

export default AIntro;
